import React from 'react'


function Destination({ destination }) {
    const {id, name, description, image} = destination
  return (
    <div>
      <div className="max-w-xs rounded shadow-lg bg-brown-50 text-center mx-auto p-4 my-6">
        <li>
          <h2 className="text-lg font-bold text-brown-900 truncate block capitalize mb-3">
            {name}
          </h2>
          <img
            className="w-full h-40 object-cover rounded mb-4"
            src={image}
            alt={name}
          />
          <p className="text-brown-700 text-sm mb-2">{description}</p>

          <hr className="border-brown-400 py-1" />

        </li>
      </div>
    </div>
  )
}

export default Destination
